Actie / Science-Fiction
100 minuten

goed

met Will Smith, Alice Braga en Charlie Tahan

Jaren nadat Dr. Alice Krippin een genezing voor kanker lijkt te hebben gevonden, heeft een mysterieus virus de hele wereld in 
zijn greep. Veel mensen zijn gestorven aan het virus en een ander deel is getransformeerd in een groep bloeddorstige vampiers. 
In de stad New York leeft enkel nog kolonel en wetenschapper Robert Neville, die druk op zoek is naar een geneesmiddel. 's 
Middags is de stad verlaten en alleen Robert en zijn hond Sam begeven zich dan op straat. Maar zodra het donker wordt komen de 
vampiers te voorschijn en gaan op zoek naar vers bloed.
